import React from "react";

interface ChildProps {
  color: string;
}

const Child = ({ color }: ChildProps) => {
  return (
    <div>
      <h1>{color}</h1>
      <button>
        Click Me
      </button>
    </div>
  );
};
export default Child;

export const ChildAsFC: React.FC<ChildProps> = ({ color }) => {
  return <div>{color}</div>;
};
